Food Prices: The Shocking Truth

Sociopolitical Documentary hosted by Jimmy Doherty, published by Channel 4 in 2014 - English narration


Information
------------------------------

Food Prices: The Shocking Truth
Jimmy Doherty examines how the big challenges of the 21st century are affecting food prices, from the rise of Asia to the power of the financial markets, and from growing population to volatile weather. In six years the price of an average food basket has gone up by 25%. And in the UK we import half of our food, which makes us extremely vulnerable to volatile prices.


1)  Part 1 
Jimmy examines how world events have affected the price some of the main staples in our food basket, including British favourites rice, beef and bread. And he examines our shrinking chocolate bars.

2)  Part 2 
Jimmy looks at some more staple foods, including coffee, eggs, pork and cornflakes, and the world events that have affected their price

